import React,{Component} from 'react';
import {Container} from 'react-bootstrap';

class footer extends Component{
    render(){
        return(
            <div className="footer-content">
                <Container>
                    <p>2019 &copy;</p>
                </Container>
            </div>            
        )
    }
}
export default footer;
